import React, {Component} from 'react'
import TodoList from "../TodoList";

export default class TodoListItem extends Component {

    constructor () {
        super();
        this.onLabelClick = () => {
            this.setState(({done}) => {
                return {
                    done: !done,
                }
            })
        }
    }

    state = {
        done: false
    };

    render() {

        const {label} = this.props;

        return (
            <span onClick={this.onLabelClick()}>
                {label}
            </span>
        );
    }

}
